                <p className='text-[2.5rem] opacity-80 pl-[5rem] pb-[1rem] leading-[3.5rem] font-montserrat font-black'>WORK <span className='text-[2.5rem] font-montserrat font-black opacity-30'>EXPERIENCE</span></p>
