                <CardW 
                worktitle="ESH VALUE TECHNOLOGIES [THE FUTURE UNIVERSITY]"
                workrole="[ Community Manager Intern ]"
                li1=""
                />
                <CardW/>
            </div>
        </div>
    );
}

export default WorkExp;
